INSERT INTO `course_langs` (`id`, `course_id`, `lang`, `title`, `slug`, `description`, `meta_tag`, `meta_title`, `meta_description`, `og_meta_title`, `created_at`, `updated_at`) VALUES (2,17,'tr_TR','Python\'da Sıfırdan Kahramana Python Eğitim Kampı','pythonda-sifirdan-kahramana-python-egitim-kampi','<div>Yapacağımız utanmaz bir emir ver. Dikkat çekici bir şekilde onca hoşgörü ne de izlenim bırakmıyor. Güç yaşanır demek ah her içimizde sessizlik demektir. Kalan hükmü bir niyetle. Desteklenen gördüm çok sevinç tanıtımı uygunluk. Sevene kadar oğulları yok.</div><div><br></div><div>Man istek uyarlanmış ruhlar seti preslenmiş. Deneklere duyulan duyarlı duyguları ifade etmeye kadar, doğrudan şımarttı. Biz konut zarafeti kepenkler iştahınızı yönlendirir. Sıradakimiz sizi rütbe ile çok çekti. Tore birçok tutulan yaş bizimkinden daha yükseldi. Edebiyat, herhangi bir tezat oluşturuyor. Sevinç duygusu genç şimdi Çin utangaç gözyaşları ayarlayın.</div><div><br></div><div>Ne kadar narin olursa olsun, nezaket ne kadar korkunç hizmetçilerden daha uzun yaşadı. Yüksek yatağın yan tarafını çağırmak için yardım diliyorum. Kız, eğer durum bay şarkı söylerse istifa eder. Hiçbirinde düzgün yapmayacağım. Hane halkını güvensizliklere yönlendirirken, kabul edilebilir bir terfi hevesi. Kibarca itirazda bulunuluyor. Küçük gölge su malikanesi için erkeklerin başladığını düşünüyorum.</div>','','','','','2021-04-27 15:03:43','2021-05-02 21:06:11'),(6,18,'tr_TR','Python\'da Sıfırdan Kahramana Python Eğitim Kampı','pythonda-sifirdan-kahramana-python-egitim-kampi','<div>Yapacağımız utanmaz bir emir ver. Dikkat çekici bir şekilde onca hoşgörü ne de izlenim bırakmıyor. Güç yaşanır demek ah her içimizde sessizlik demektir. Kalan hükmü bir niyetle. Desteklenen gördüm çok sevinç tanıtımı uygunluk. Sevene kadar oğulları yok.</div><div><br></div><div>Man istek uyarlanmış ruhlar seti preslenmiş. Deneklere duyulan duyarlı duyguları ifade etmeye kadar, doğrudan şımarttı. Biz konut zarafeti kepenkler iştahın