INSERT INTO `jobs` (`id`, `title`, `position`, `company_name`, `category_id`, `vacancy`, `job_responsibility`, `employment_status`, `education_requirement`, `job_context`, `experience_requirement`, `additional_requirement`, `job_location`, `salary`, `other_benefits`, `email`, `status`, `lang`, `deadline`, `meta_tags`, `slug`, `meta_description`, `application_fee`, `application_fee_status`, `created_at`, `updated_at`) VALUES (5,'Kıdemli Yönetici (Hesaplar)','Junior Accounts','xgenious','7','6','İşlemleri kaydederek, doğrulayarak, birleştirerek ve girerek muhasebe bilgilerinin bütünlüğünü sağlar.\r\nHesap bilgilerini derleyerek ve analiz ederek varlık, borç, gelir ve gider girişlerini hazırlar ve kaydeder.\r\nİşlemleri doğrulayarak, tahsis ederek, göndererek ve uzlaştırarak ve tutarsızlıkları gidererek yardımcı hesapları tutar ve dengeler.\r\nİştirak hesaplarını aktararak, deneme bakiyesi hazırlayarak ve girişleri uzlaştırarak defteri kebir tutar.\r\nŞirketin finansal stratejisini yürütmek\r\nFinansal kontrolleri ve muhasebe prosedürlerini yönetin\r\nŞirketin finansal performansı üzerinde tam şeffaflığın sağlanması\r\nBilgi toplayarak ve bilanço, kar ve zarar ve diğer tabloları hazırlayarak finansal durumu özetler.\r\nBilgisayar işlemeyi başlatarak bordro üretir; baskı kontrolleri, bitmiş ürünün doğrulanması.\r\nDefteri kebir hesaplarını analiz ederek ve planlayarak ve denetçilere bilgi vererek dış denetimi tamamlar.\r\nYasal gerekliliklere uyarak yasal zorluklardan kaçınır.\r\nVeritabanı yedeklerini tamamlayarak finansal bilgileri korur.\r\nBilgileri gizli tutarak kuruluşun değerini korur. Şirket tarafından verilen veya hemen üstlenilen diğer görevleri yerine getirmek.\r\nSatış, üretim ve stok hakkında aylık bazda bir rapor gönderin.\r\nGerekli tüm evrakların tüm bölümler tarafından izlenmesi.\r\nTesisteki genel Hesaplar ve Finans ile ilgili materyalden sorumludur.\r\nDiğerleri bölüm başkanı / yönetimi tarafından görevlendirilir.','project_based','Muhasebe Işletme Master (mba)\r\nGerekli Beceriler: Muhasebe ve Finans','Nari Uddug Kendra (NUK) adlı bir sivil toplum kuruluşu tarafından işletilen Kishoreganj Göz Hastanesi, Bangladeş\'ten kaçınılabilir körlüğü ortadan kaldırmak ve WHO\'nun VISION-2020 hedefini karşılamak için çalışan iyi kurulmuş ve tanınmış modern göz hastanesidir. Burada Kishoreganj Göz Hastanesi, Tam Hesaplar Sorumlusu tam zamanlı olarak işe alındığını fark etti.','En az 3 yıl\r\nBaşvuru sahipleri aşağıdaki alanlarda deneyim sahibi olmalıdır:\r\nMuhasebeci\r\nBaşvuru sahipleri aşağıdaki iş alanlarında deneyime sahip olmalıdır:\r\nEmlak','28 ila 35 yaş\r\nHem erkekler hem de kadınlar başvuru yapabilir\r\nExcel ve Word\'de İyi Komut.\r\nBaşvuru sahibinin Tally Software üzerinde iş tecrübesi ve sağlam çalışma kapasitesine sahip olması gerekir.\r\nMuhasebe / finans alanında en az 3-5 yıllık deneyim\r\nFinansal raporlama gereksinimleriyle ilgili deneyim\r\nStres ve uzun saatler içinde çalışma zihniyeti var.\r\nİyi bilgisayar bilgisi gerekir (taksitli yazılım ile).','Bangkok, Thailand','tartışılabilir','Şirket Politikasına Göre',NULL,'publish','tr_TR','2020-08-26',NULL,'kidemli-yonetici-hesaplar',NULL,NULL,NULL,'2020-07-20 19:38:26','2021-03-18 14:33:31'),(8,'Grafik Tasarımcı','Küçük Tasarımcı','xgenious','9','8','Logo, Afiş, Broşür, PSD, Yerleşim, Kitapçık ile ilgili düzenleme / rötuş ve dijital pazarlama / medya ile ilgili eserler tasarlayabilme.\r\nRenk, boyut, stil, yazı tipi boyutu ve kompozisyonun etkili kullanımı dahil olmak üzere yenilikçi ve yetenekli tasarım geliştirme.\r\nAdobe Photoshop, Adobe Illustrator, After Effects, Adobe In Design, Adobe Premiere Pro, Adobe Dreamweaver, PowerPoint ve diğer ilgili tasarım / düzenleme yazılımlarında uzman olmalıdır.\r\nMultimedya tabanlı mizanpajlar, grafikler, animasyon, video, çevrimiçi öğreticiler ve dijital pazarlama ile ilgili diğer prodüksiyonların tasarımı ve geliştirilmesi için teknik görevleri yerine getirmek.\r\nMüşterinin iş sorununu, marka alanını, hedef kitleyi ve genel yaratıcı stratejiyi anlama.\r\nGrafik tasarımda en yüksek standartları korumak ve hem dijital pazarlama hem de sosyal medya pazarlaması için müşterinin beklentilerini doğru bir şekilde temsil eden en son yaratıcı içeriği üretmek.\r\nYönetim tarafından atanan diğer tüm görevler.','part_time','Grafik Tasarım veya dengi diploma','İş yeri: Genel Merkez, Dhanmondi R / A, Dhaka\r\nGörev: Cumartesi - Perşembe - Saat 9:30 - 18:00','En az 3 yıl','20 ila 35 yaş\r\nHem erkekler hem de kadınlar başvuru yapabilir\r\nBir ekipte ve gerektiğinde Yönetim talimatına uygun olarak çalışmaya hazır.\r\nYaratıcı çözüm sunmak için fikirleri sorun, test edin ve analiz edin.\r\nDetaylara piksel düzeyinde dikkat ile tipografi, kompozisyon, düzen, renk, yüksek kaliteli üretim için göz.\r\nİçerik yönetimi platformlarıyla deneyim.\r\nGüçlü kişilerarası ve mesleki beceriler.\r\nUluslararası standartlarda bir MARKA geliştirme konusunda derin bir his.','Bangkok, Thailand','tartışılabilir','Mobil fatura\r\nMaaş İncelemesi: Yıllık\r\nFestival Bonusu: 2\r\nÖğle Yemeği Olanakları',NULL,'publish','tr_TR','2020-08-27',NULL,'grafik-tasarimci',NULL,NULL,NULL,'2020-07-20 19:53:03','2021-03-18 14:33:31');
